import React from "react";
import "./Date.css";

export default function Date({ formatDate }) {
  return (
    <div className="Date">
      <span className="week-day" id="current-date">
        console.log(formatDate) 12 0 0
      </span>
      <div className="time-now" id="current-time">
        21:21
      </div>
    </div>
  );
}
